import { useState } from 'react';
import axios from 'axios';
import './App.css';
import WeatherComponent from './components/WeatherComponent';
import CityComponent from './components/CityComponent';

const API_key = "38ca4b8e07c7267756afb7f1e5fc9ac0";
function App() {
  const [city, setCity] = useState("");
  const [weather, setWeather] = useState('');

  const fatchWeather = async() =>{
    const response = await axios.get(`api.openweathermap.org/data/2.5/weather?q=${city}&appid=${API_key}`);
  console.response(response); 
  }
  return (
    <div className="App">
      {/* <div className= "app-card">
       <h1> React Weather App </h1>
      </div> */}
      <WeatherComponent/>
      <CityComponent  setCity = {setCity} fatchWeather = {fatchWeather}/>
    </div>
  );
}

export default App;
